    const [ state, setState ] = useState({});
    useEffect(() => {
        console.log(props )
    }, [props]);


    const renderMeta = props.data.map(meta=>{
        return (
            <div>
                <p>{meta}</p>
            </div>
        )
    })
    return (
        <div>
            MetaWidget
            {renderMeta}
        </div>
    );
};
export default MetaWidget;
